import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import { 
  FaHome, 
  FaNewspaper, 
  FaFolder, 
  FaBookOpen, 
  FaChartBar,
  FaBars
} from 'react-icons/fa';

const Navigation: React.FC = () => {
  const location = useLocation();

  const isActive = (path: string) => {
    return location.pathname === path;
  };

  return (
    <nav className="bg-white shadow-lg border-b border-gray-200 sticky top-0 z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16">
          {/* Logo and Brand */}
                           <div className="flex items-center">
                   <Link to="/" className="flex items-center space-x-2">
                     <div className="w-8 h-8 bg-gradient-to-r from-purple-500 to-pink-500 rounded-lg flex items-center justify-center">
                       <FaNewspaper className="text-white text-sm" />
                     </div>
                     <span className="text-xl font-bold text-gray-900">NewsAI</span>
                   </Link>
                 </div>

          {/* Navigation Links */}
          <div className="hidden md:flex items-center space-x-8">
                               <Link
                     to="/"
                     className={`px-3 py-2 rounded-md text-sm font-medium transition-colors flex items-center space-x-2 ${
                       isActive('/') 
                         ? 'bg-purple-100 text-purple-700' 
                         : 'text-gray-600 hover:text-purple-600 hover:bg-purple-50'
                     }`}
                   >
                     <FaHome className="text-sm" />
                     <span>Home</span>
                   </Link>

                               <Link
                     to="/news"
                     className={`px-3 py-2 rounded-md text-sm font-medium transition-colors flex items-center space-x-2 ${
                       isActive('/news') 
                         ? 'bg-purple-100 text-purple-700' 
                         : 'text-gray-600 hover:text-purple-600 hover:bg-purple-50'
                     }`}
                   >
                     <FaNewspaper className="text-sm" />
                     <span>Latest News</span>
                   </Link>

                               <Link
                     to="/categories"
                     className={`px-3 py-2 rounded-md text-sm font-medium transition-colors flex items-center space-x-2 ${
                       isActive('/categories') 
                         ? 'bg-purple-100 text-purple-700' 
                         : 'text-gray-600 hover:text-purple-600 hover:bg-purple-50'
                     }`}
                   >
                     <FaFolder className="text-sm" />
                     <span>Categories</span>
                   </Link>

                               <Link
                     to="/reading-list"
                     className={`px-3 py-2 rounded-md text-sm font-medium transition-colors flex items-center space-x-2 ${
                       isActive('/reading-list') 
                         ? 'bg-purple-100 text-purple-700' 
                         : 'text-gray-600 hover:text-purple-600 hover:bg-purple-50'
                     }`}
                   >
                     <FaBookOpen className="text-sm" />
                     <span>Reading List</span>
                   </Link>

                               <Link
                     to="/analytics"
                     className={`px-3 py-2 rounded-md text-sm font-medium transition-colors flex items-center space-x-2 ${
                       isActive('/analytics') 
                         ? 'bg-purple-100 text-purple-700' 
                         : 'text-gray-600 hover:text-purple-600 hover:bg-purple-50'
                     }`}
                   >
                     <FaChartBar className="text-sm" />
                     <span>Analytics</span>
                   </Link>
          </div>

                           {/* Mobile menu button */}
                 <div className="md:hidden flex items-center">
                   <button className="text-gray-600 hover:text-purple-600">
                     <FaBars className="h-6 w-6" />
                   </button>
                 </div>
        </div>
      </div>

      {/* Mobile Navigation */}
      <div className="md:hidden">
        <div className="px-2 pt-2 pb-3 space-y-1 sm:px-3 bg-gray-50">
                           <Link
                   to="/"
                   className={`block px-3 py-2 rounded-md text-base font-medium flex items-center space-x-2 ${
                     isActive('/') ? 'bg-purple-100 text-purple-700' : 'text-gray-600 hover:text-purple-600 hover:bg-purple-50'
                   }`}
                 >
                   <FaHome className="text-sm" />
                   <span>Home</span>
                 </Link>
                           <Link
                   to="/news"
                   className={`block px-3 py-2 rounded-md text-base font-medium flex items-center space-x-2 ${
                     isActive('/news') ? 'bg-purple-100 text-purple-700' : 'text-gray-600 hover:text-purple-600 hover:bg-purple-50'
                   }`}
                 >
                   <FaNewspaper className="text-sm" />
                   <span>Latest News</span>
                 </Link>
                           <Link
                   to="/categories"
                   className={`block px-3 py-2 rounded-md text-base font-medium flex items-center space-x-2 ${
                     isActive('/categories') ? 'bg-purple-100 text-purple-700' : 'text-gray-600 hover:text-purple-600 hover:bg-purple-50'
                   }`}
                 >
                   <FaFolder className="text-sm" />
                   <span>Categories</span>
                 </Link>
          <Link
            to="/reading-list"
            className={`block px-3 py-2 rounded-md text-base font-medium ${
              isActive('/reading-list') ? 'bg-purple-100 text-purple-700' : 'text-gray-600 hover:text-purple-600 hover:bg-purple-50'
            }`}
          >
            ðŸ“š Reading List
          </Link>
          <Link
            to="/analytics"
            className={`block px-3 py-2 rounded-md text-base font-medium ${
              isActive('/analytics') ? 'bg-purple-100 text-purple-700' : 'text-gray-600 hover:text-purple-600 hover:bg-purple-50'
            }`}
          >
            ðŸ“Š Analytics
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default Navigation;
